    words.erase(std::remove(words.begin(), words.end(), "cherry"), words.end());

    // Print the updated words
    std::cout << "Words after removing cherry: ";
    for (const auto& word : words) {
        std::cout << word << " ";
    }
    std::cout << std::endl;

    return 0;
}

